from itertools import count, islice
def agen():    # generator of terms
    slst, alst, an = [], [], 2
    S = {"4"}  # strings of products of two terms (including self products)
    while True:
        alst.append(an)
        slst.append(str(an))
        yield an
        for k in count(an+1):
            sk = str(k)
            if any(sk in s for s in S): continue
            Pk = [str(ai*k) for ai in alst] + [str(k*k)]
